Defendant in custody on WRIT.
The State files an Amended Information which charges one count 3rd degree sexual assault, contrary to Section 940.225(3) and one counts 4th degree sexual assault, contrary to Section 940.225(3m) of the Wisconsin Statutes.
NO CONTEST pleas entered to both counts in the Amended Information.  Convicted.
On count 1, sentence is withheld and the defendant is placed on probation to DOC for five (5) years, consecutive to the prison sentences presently being served on Ozaukee County case no: 12 CF 268 and 12 CF 269, to commence upon defendants discharge date after extended supervision ends.
Conditions of probation;
1) pay court costs;
2) pay supervision fees in an amount to be determined by DOC;
3) defendant is required to comply with the Sex Offender Registry for a period of fifteen (15) years following the completion of his sentence;
4) defendant is to have no contact with E.D.S., DOB: 07-03-2000 or family;
5) assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
6) no use of the internet or internet enabled devices at the agents discretion;
7) maintain fulltime employment, schooling, combination.
On count 2, the defendant is sentenced to ninety (90) days incarceration, consecutive to the prison sentences presently being served on Ozaukee County cases 12 CF 268 and 12 CF 269.
$280.00 court costs imposed, to be paid by 03-21-2019 or 5 days county jail for failure to pay.
Minutes.
